import { React, useState, useEffect } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

export function Home() {
  const [state, setState] = useState({
    meal: [],
  });

  const fetctData = async () => {
    const data = await (await fetch("http://localhost:5000/meal")).json();

    console.log(data);
    setMeals(data);
  };

  useEffect(() => {
    fetctData();
  }, []);

  return (
    <Router>
      <div>
        <h1>Meal App</h1>
      </div>
      <Switch>
        <Route>
          <Meal meals={meals} />
        </Route>
      </Switch>
    </Router>
  );
}

function Meal({ meals }) {
  return (
    <div>
      {meals.map((meal) => (
        <div key={meal.id}>
          <h2>{meal.title}</h2>
          <h3>{meal.created_date}</h3>
        </div>
      ))}
    </div>
  );
}
